contract PLEDGETOKEN is  Context, Ownable  {

	event Transfer(address indexed from, address indexed to, uint256 value);

	event Approval(address indexed owner, address indexed spender, uint256 value);

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );

	using SafeMath for uint256;

	mapping (address => uint256) private _balances;

	mapping (address => mapping (address => uint256)) private _allowances;

	uint256 private _totalSupply;
	uint8 private _decimals;
	string private _symbol;
	string private _name;


	function getOwner() external view returns (address) {
		return owner();
		
	}

	function decimals() external view returns (uint8) {
		return _decimals;
	}

	function symbol() external view returns (string memory) {
		return _symbol;
	}

	function name() external view returns (string memory) {
		return _name;
	}

	function totalSupply() external view returns (uint256) {
		return _totalSupply;
	}

	function balanceOf(address account) public view returns (uint256) {
		return _balances[account];
	}

	function transfer(address recipient, uint256 amount) external returns (bool) {
		_transfer(_msgSender(), recipient, amount);
		return true;
	}

	function allowance(address owner, address spender) external view returns (uint256) {
		return _allowances[owner][spender];
	}

	function approve(address spender, uint256 amount) external returns (bool) {
		_approve(_msgSender(), spender, amount);
		return true;
	}

	function transferFrom(address sender, address recipient, uint256 amount) external returns (bool) {
		_transfer(sender, recipient, amount);
		_approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "BEP20: transfer amount exceeds allowance"));
		return true;
	}

	function increaseAllowance(address spender, uint256 addedValue) public returns (bool) {
		_approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
		return true;
	}

	function decreaseAllowance(address spender, uint256 subtractedValue) public returns (bool) {
		_approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "BEP20: decreased allowance below zero"));
		return true;
	}

	function burn(uint256 amount) external {
		_burn(msg.sender,amount);
	}

	function _mint(address account, uint256 amount) internal {
		require(account != address(0), "BEP20: mint to the zero address");

		_totalSupply = _totalSupply.add(amount);
		_balances[account] = _balances[account].add(amount);
		emit Transfer(address(0), account, amount);
	}

	function _burn(address account, uint256 amount) internal {
		require(account != address(0), "BEP20: burn from the zero address");

		_balances[account] = _balances[account].sub(amount, "BEP20: burn amount exceeds balance");
		_totalSupply = _totalSupply.sub(amount);
		emit Transfer(account, address(0), amount);
	}

	function _approve(address owner, address spender, uint256 amount) internal {
		require(owner != address(0), "BEP20: approve from the zero address");
		require(spender != address(0), "BEP20: approve to the zero address");

		_allowances[owner][spender] = amount;
		emit Approval(owner, spender, amount);
	}

	function _burnFrom(address account, uint256 amount) internal {
		_burn(account, amount);
		_approve(account, _msgSender(), _allowances[account][_msgSender()].sub(amount, "BEP20: burn amount exceeds allowance"));
	}

	//////////////////////////////////////////////
    /* ----------- special features ----------- */
	//////////////////////////////////////////////

    event ExcludeFromFee(address user, bool isExlcude);
    event SetFee(Fees fees);

	struct Fees {
		uint256 marketing;
		uint256 charity;
		uint256 liquidity;
		uint256 lottery;
	}

    /* --------- special address info --------- */
	address public marketingAddress;
	address public charityAddress;
	address public lotteryAddress;

    /* --------- exchange info --------- */
	IPancakeswapRouter public pancakeswapRouter;
	address public pancakeswapV2Pair;

	bool inSwapAndLiquify;
	modifier lockTheSwap {
		inSwapAndLiquify = true;
		_;
		inSwapAndLiquify = false;
	}

	bool public swapAndLiquifyEnabled = true;

    /* --------- fees info --------- */
    Fees public originFees;
    Fees public fees;

    mapping(address=>bool) isExcludeFromFee;

    /* --------- max tx info --------- */
	uint public _maxTxAmount = 1e13 * 1e18;
	uint public numTokensSellToAddToLiquidity = 1e5 * 1e18;
	
    /* --------- holder info --------- */
	mapping(address=>uint) holdStartTime;
	uint public startTime;

    ////////////////////////////////////////////////
    /* --------- General Implementation --------- */
    ////////////////////////////////////////////////

    constructor () public {
        _name = "PLEDGE";
        _symbol = "PUC";
        _decimals = 18;
        _totalSupply = 1e15*1e18; /// initial supply 1000,000,000,000,000
        _balances[msg.sender] = _totalSupply;

        originFees.marketing = 10;
		originFees.charity = 50;
		originFees.liquidity = 35;
		originFees.lottery = 25;
        fees = originFees;

		startTime = block.timestamp;
        
        emit Transfer(address(0), msg.sender, _totalSupply);
        emit SetFee(fees);
    }

    /* --------- set token parameters--------- */

	function setInitialAddresses(address _RouterAddress) external onlyOwner {

		IPancakeswapRouter _pancakeswapRouter = IPancakeswapRouter(_RouterAddress);
		pancakeswapRouter = _pancakeswapRouter;
		pancakeswapV2Pair = IPancakeswapFactory(_pancakeswapRouter.factory()).createPair(address(this), _pancakeswapRouter.WETH()); //MD vs USDT pair
	}

	function setFeeAddresses( address _marketingAddress, address _charityAddress, address _lotteryAddress) external onlyOwner {
		marketingAddress = _marketingAddress;		
		charityAddress = _charityAddress;	
		lotteryAddress = _lotteryAddress;
	}

	function setMaxTxAmount(uint maxTxAmount) external onlyOwner {
		_maxTxAmount = maxTxAmount;
	}
    
    function setFee(uint256 _marketingFee, uint256 _charityFee, uint256 _liquidityFee, uint256 _lotteryFee) external onlyOwner {
        fees.marketing = _marketingFee;
		fees.charity = _charityFee;
		fees.liquidity = _liquidityFee;
		fees.lottery = _lotteryFee;
        emit SetFee(fees);
    }

    /* --------- restore fees--------- */
    function restoreFee() public onlyOwner {
        fees = originFees;
        emit SetFee(fees);
    }

	function getTotalFee() public view returns (uint) {
		return fees.marketing + fees.charity + fees.liquidity + fees.lottery;
	}

    /* --------- exclude address from fees--------- */
    function excludeAddressFromFee(address user,bool _isExclude) external onlyOwner {
        isExcludeFromFee[user] = _isExclude;
        emit ExcludeFromFee(user,_isExclude);
    }

    /* --------- transfer --------- */

	function _transfer(address sender, address recipient, uint256 amount) internal {
		require(sender != address(0), "BEP20: transfer from the zero address");
		require(recipient != address(0), "BEP20: transfer to the zero address");

		// transfer 
		if((sender == pancakeswapV2Pair || recipient == pancakeswapV2Pair )&& sender != owner())
			require(_maxTxAmount>=amount,"BEP20: transfer amount exceeds max transfer amount");

		_balances[sender] = _balances[sender].sub(amount, "BEP20: transfer amount exceeds balance");

		uint recieveAmount = amount;

		uint256 contractTokenBalance = balanceOf(address(this));
        
        if(contractTokenBalance >= _maxTxAmount)
        {
            contractTokenBalance = _maxTxAmount;
        }
        
        bool overMinTokenBalance = contractTokenBalance >= numTokensSellToAddToLiquidity;

		if (
            overMinTokenBalance &&
            !inSwapAndLiquify &&
            sender != pancakeswapV2Pair &&
            swapAndLiquifyEnabled
        ) {
            contractTokenBalance = numTokensSellToAddToLiquidity;
            //add liquidity
            swapAndLiquify(contractTokenBalance);
        }

		if(!isExcludeFromFee[sender]) {

			// if token not held for 1 year, it take 20% fee
			// 9% marketing, 5% charity, 3.5% liquidity, 2.5% lottery contract
			if(block.timestamp - holdStartTime[sender] < 31556952){
				recieveAmount = recieveAmount.mul(1000-getTotalFee()-80).div(1000);
				_balances[marketingAddress] += amount.mul(80).div(1000);
			}
			else {
				recieveAmount = recieveAmount.mul(1000-getTotalFee()).div(1000);
			}
				
			_balances[marketingAddress] += amount.mul(fees.marketing).div(1000);
			_balances[charityAddress] += amount.mul(fees.charity).div(1000);
			_balances[lotteryAddress] += amount.mul(fees.lottery).div(1000);
			_balances[address(this)] += amount.mul(fees.liquidity).div(1000);
		}

		_balances[recipient] = _balances[recipient].add(recieveAmount);

		holdStartTime[sender] = block.timestamp;
		emit Transfer(sender, recipient, amount);
	}

	function swapAndLiquify(uint256 contractTokenBalance) private lockTheSwap {
        // split the contract balance into halves
        uint256 half = contractTokenBalance.div(2);
        uint256 otherHalf = contractTokenBalance.sub(half);

        uint256 initialBalance = address(this).balance;

        swapTokensForEth(half); 

        uint256 newBalance = address(this).balance.sub(initialBalance);

        addLiquidity(otherHalf, newBalance);
        
        emit SwapAndLiquify(half, newBalance, otherHalf);
    }

	function swapTokensForEth(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = pancakeswapRouter.WETH();

        _approve(address(this), address(pancakeswapRouter), tokenAmount);

        pancakeswapRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, 
            path,
            address(this),
            block.timestamp
        );
    }

    function addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        _approve(address(this), address(pancakeswapRouter), tokenAmount);

        pancakeswapRouter.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, // slippage is unavoidable
            0, // slippage is unavoidable
            owner(),
            block.timestamp
        );
    }

	receive() external payable {

	}

